import React from "react";
import Card from "../Card";
import "./style.css";

function CardContainer({ image, lastname, firstname, email, language }) {
  return (
    <div className="jumbotron card-container">
      <Card lastname={lastname} firstname={firstname} image={image} email={email} language={language}/>
    </div>
  );
}

export default CardContainer;
